  justify-content: center;
`;

export const ServiceSessionsContainer = styled.div`
  display: flex;
  align-items: flex-start;
  flex-direction: column;
  justify-content: space-between;
  margin: 32px 0px;
  width: 1110px;
`;

export const ServiceWrapper = styled.div`
  width: 100%;
